import React, {Component} from 'react';
import './Homepage.css';
import './css/main.css';
import './css/util.css';

function Homepage({props}) {

    const name = props.name;
    return (
        <div >
            <h1>Welcome {name}.</h1>
        </div>
    )
}
export default Homepage;
